import {Observable, of} from 'rxjs';

import {Pet} from './pet';
import {PETS} from './mock-pets';

@Injectable({
  providedIn: 'root'
})
export class PetService {

  constructor() { }

  getPets(): Observable<Pet[]> {
    return of(PETS);
  }
}
